    public string item
    {
        get { return itemValue; }
        set
        {
            CurrentValue = initializers.Count();
            if (value.Length > 0)
            {
                initializers = initializers2.Where(x => x.PersonSurname.ToLower().Contains(value)).ToList();
            }
            else
            {
                initializers = initializers2;
